import React from "react";
import FirstAgriculture from "./FirstAgriculture";
import SecondAgriculture from "./SecondAgriculture";
import ThirdAgriculture from "./ThirdAgriculture";
import Footer from "../Footer/Footer";

const Agriculture = () => {
  return (
    <>
    <FirstAgriculture />
    <SecondAgriculture />
    <ThirdAgriculture />
    <Footer />
    </>
  );
};

export default Agriculture;
